import React from 'react';
import { useParams } from 'react-router-dom';

function HouseDetails() {
  const { houseid } = useParams();

  return (
    <div>
        <h1>Booking screen</h1>
        <h1>House id = {houseid}</h1>
    </div>
  )
}

export default HouseDetails;
